import React, { Component } from 'react'

export class Good extends Component {
  render() {
    return (
      <div className='good'>
        <img src={''} />
        {this.props.Good.title}
        {this.props.Good.desc}
        {this.props.Good.categori}
        {this.props.Good.price}
        <div className='addcorz'>+</div>
        </div>
    )
  }
}

export default Good
